import React from "react"

import classes from './App.modules.css';

function App(){
  return(
    <div className="App">
      <header className="App-header">
        <nav className={classes}>
          <img src="https://i.dlpng.com/static/png/197684_preview.png" 
          alt="Amazon logo"/>
        </nav>
      </header>
    </div>
  )
}

export default App
